import React from 'react';
import './TimelineStyles.css'; // Reuse same styling

const ExperienceSection = () => {
  return (
    <section className="timeline-section">
      <h2 className="section-title">My Experiences</h2>

      {/* Experience 1 */}
      <div className="timeline">
        <div className="timeline-point" />
        <div className="timeline-content">
          <h3>Software Engineer – Smart Desert Pvt Ltd | Bengaluru</h3>
          <p>May 2022 – Aug 2024</p>
          <ul>
            <li>Built a social media platform using the MERN stack (MongoDB, Express.js, React, Node.js).</li>
            <li>Integrated Stripe for secure payment transactions.</li>
            <li>Ensured backend reliability and performance using SQL/Python scripts and Git version control.</li>
          </ul>
        </div>
      </div>

    </section>
  );
};

export default ExperienceSection;
